import React from 'react';

export class Login extends React.Component {
    render() {

        return (
            <div>
                <input type="text" placeholder="Username" />
                <input type="text" placeholder="Password" />
                <br />
                <br />
                <input type="Submit" value = "Submit" />
            </div>
        );
    }
}
